import React from 'react';
import {Route} from 'react-router-dom';

const RouteNormal = ({
    layout : Layout,
    component: Component,   
    ...props
}) => { 
    if(!Layout){
        return <Component {...props} />
    }
    return (
        <Layout>
            <Component {...props}/>
        </Layout>
    );
};

export default RouteNormal;
